import React from "react";
import { CompanyConteiner, VectorTop } from "./style";
import { Icon } from "Shared/svg/Icon";

export default function CompanyPage() {
  return (
    <>
      <VectorTop />
      <CompanyConteiner>
        <Icon id="man" className="logo company" />
      </CompanyConteiner>
    </>
  );
}
